---
grammars:
  version: "0.1"
  exports:
    - name: Start
      type: rule
      params:
        - name: depth
          type: f32
        - name: height
          type: f32
        - name: width
          type: f32
  grammar:
    - name: Main
      attr:
        - name: depth
          value: "8.0"
        - name: height
          value: "28.0"
        - name: width
          value: "15.0"
        - name: awning
          value: "0.35"
        - name: roof_color
          random:
            seed: 42
            source: shape
            type: c32
          values:
            - "8095370"
            - "8684674"
            - "7833753"
            - "7107965"
            - "11119017"
            - "11577759"
            - "7764867"
            - "6582115"
            - "9145466"
        - name: color
          random:
            seed: 42
            source: shape
            type: c32
          values:
            - "11674146"
            - "10824234"
            - "13320532"
            - "9109504"
            - "11160132"
            - "10249759"
            - "10636357"
            - "8864063"
            - "12077625"
        - name: facade_tex
          random:
            seed: 42
            source: shape
            type: string
          values:
            - SeamlessBrick02.JPG
            - SeamlessBrick03.JPG
            - SeamlessBrick04.JPG
            - SeamlessBrick05.JPG
            - SeamlessBrick06.JPG
            - SeamlessBrick12.JPG
            - SeamlessBrick13.JPG
            - SeamlessBrick14.JPG
      rule:
        - name: Start
          op:
            - extrude:
                height: height
            - comp:
                - name: side
                  value: Facade
                - name: top
                  value: Roof
        - name: Top
          op:
            - offset:
                distance: awning
                inside: AwningExtrude
        - name: AwningExtrude
          op:
            - extrude:
                height: awning
            - comp:
                - name: bottom
                  value: Wall
                - name: side
                  value: Wall
                - name: top
                  value: AwningTop
        - name: AwningTop
          op:
            - offset:
                distance: "-awning"
                border: Wall
                inside: AwningInside
        - name: AwningInside
          op:
            - extrude:
                height: "-awning*0.8"
            - comp:
                - name: side
                  value: Wall
                - name: top
                  value: Roof
        - name: Roof
          op:
            - setupProjection:
                axes: scope.xy
                width:
                  value: "1"
                  type: relative
                height:
                  value: "1"
                  type: relative
            - texture:
                path: roof2.png
            - color:
                s: roof_color
            - hip:
                angle: "30.0"
        - name: Wall
          op:
            - texture:
                path: facade_tex
    - attr:
        - name: FloorHeight
          value: "2.1"
        - name: DividerHeight
          value: "0.15"
        - name: EdgeWidth
          value: "0.4"
        - name: InsideWidth
          value: "1.8"
        - name: Window
          value: "1.0"
        - name: Sill
          value: "0.3"
        - name: win_tex
          random:
            seed: 42
            source: shape
            type: string
          values:
            - c_window1.jpg
            - c_window2.jpg
            - c_window3.jpg
      rule:
        - name: Facade
          op:
            - setupProjection:
                axes: scope.xy
                width:
                  value: "5"
                  type: absolute
                height:
                  value: "5"
                  type: absolute
            - split:
                axis: y
                sizes:
                  - value: FloorHeight
                    name: Floor
                    repeat: true
                    type: floating
                  - value: DividerHeight
                    name: Wall
                    type: floating
        - name: Floor
          op:
            - split:
                axis: x
                sizes:
                  - value: EdgeWidth
                    name: Wall
                    type: floating
                  - value: InsideWidth
                    name: VerticalFrame
                    repeat: true
                    type: floating
                  - value: EdgeWidth
                    name: Wall
                    type: floating
        - name: VerticalFrame
          op:
            - split:
                axis: y
                sizes:
                  - value: Sill
                    name: Wall
                    type: floating
                  - value: "0.2"
                    name: WinTop
                    type: absolute
                  - value: Window
                    name: HorizontalFrame
                    type: floating
                  - value: "0.2"
                    name: WinTop
                    type: absolute
                  - value: Sill
                    name: Wall
                    type: floating
        - name: WinTop
          op:
            - split:
                axis: x
                sizes:
                  - value: Sill
                    name: Wall
                    type: floating
                  - value: Window + 0.4
                    name: WinFrame
                    type: floating
                  - value: Sill
                    name: Wall
                    type: floating
        - name: HorizontalFrame
          op:
            - split:
                axis: x
                sizes:
                  - value: Sill
                    name: Wall
                    type: floating
                  - value: "0.2"
                    name: WinFrame
                    type: floating
                  - value: Window
                    name: WinTexture
                    type: floating
                  - value: "0.2"
                    name: WinFrame
                    type: floating
                  - value: Sill
                    name: Wall
                    type: floating
        - name: WinFrame
          op:
            - color:
                s: "#aaaaaa"
        - name: WinTexture
          op:
            - setupProjection:
                axes: scope.xy
                width:
                  value: "1"
                  type: relative
                height:
                  value: "1"
                  type: relative
            - texture:
                path: win_tex
    - name: "562549939"
      attr:
        - name: height
          value: "28.0"
      rule:
        - name: "562549939"
          op:
            - extrude:
                height: height * 5
            - comp:
                - name: side
                  value: Facade
                - name: top
                  value: Roof2
        - name: Roof2
          op:
            - setupProjection:
                axes: scope.xy
                width:
                  value: "1"
                  type: relative
                height:
                  value: "1"
                  type: relative
            - color:
                s: "#FF00FF"
